import NavBar from "./componentes/NavBar"

function App() {
  return (
    <div className="App">
    <Context.Provider>
        <BrowserRouter>
        <NavBar/>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/carrito" element={<Carrito />} />
          <Route path="/pizza/:id" element={<PizzaDetalle />} />
        </Routes>
        </BrowserRouter>
      </Context.Provider>
    </div>
  );
}

export default App;
